import React from "react";
import "./Navbar.css";

// Depending on the current path, this component sets the "active" class on the appropriate navigation link item
const NavBar = props => (


  <nav className="navbar navbar-expand-lg navbar-light bg-light">
    <a className="navbar-brand" href="/">
      {/* <img src="/image/nohover-logo.png" id="veym-logo" /> */}
      <div className="logo"></div>
    </a>
    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
      <span className="navbar-toggler-icon"></span>
    </button>
    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div className="navbar-nav">
        <a className="nav-item nav-link active" href="/">Home <span className="sr-only">(current)</span></a>
        <a className="nav-item nav-link" href="/about-us">About Us </a>
        <a className="nav-item nav-link" href="/our-regions">Our Regions </a>
        <a className="nav-item nav-link" href="/news">News </a>
        <a className="nav-item nav-link" href="/resources">Resources </a>
        <a className="nav-item nav-link" href="/store">TNTT Store </a>
      </div>
    </div>
  </nav>
);

export default NavBar;
